import logo from './logo.svg';
import './App.css';
import Container from '@material-ui/core/Container';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
        <Container maxWidth="md">
        <div className="new-task"></div>
        <div className="todo-list"></div>
        </Container>

    </div>
  );
}

export default App;
